// src/components/Experience.js
import React from 'react';
import './Experience.css';
import company1 from '/Users/avi/Desktop/mywebsite/personal-website/src/clio___cloud_based_legal_technology_logo.jpeg';
import company2 from '/Users/avi/Desktop/mywebsite/personal-website/src/digitalforcescorporation_logo.jpeg';
import company3 from '/Users/avi/Desktop/mywebsite/personal-website/src/revenuecat_logo.jpeg';

const Experience = () => {
  const experiences = [
    {
      title: 'Frontend Developer',
      company: 'Clio',
      duration: 'Jan 2021 - Present',
      description: 'Working on amazing projects that involve React, CSS animations, and more.',
      logo: company1,
    },
    {
      title: 'Junior Developer',
      company: 'Digital Forces Inc.',
      duration: 'Jun 2019 - Dec 2020',
      description: 'Contributed to building scalable and user-friendly applications.',
      logo: company2,
    },
    {
      title: 'Software Consultant',
      company: 'Revenue Cat',
      duration: 'Jan 2024- May 2024',
      description: 'Learned the fundamentals of web development and worked on small projects with mentorship',
      logo: company3,
    },
  ];

  return (
    <section id="experience" className="experience">
      <h2>Experience</h2>
      <div className="timeline">
        {experiences.map((exp, index) => (
          <div key={index} className="timeline-item">
            <div className="timeline-dot"></div>
            <div className={`timeline-content-wrapper ${index % 2 === 0 ? 'left' : 'right'}`}>
              <div className="company-logo">
                <img src={exp.logo} alt={`${exp.company} logo`} />
              </div>
              <div className="timeline-content">
                <h3>{exp.title}</h3>
                <h4>{exp.company}</h4>
                <span className="experience-duration">{exp.duration}</span>
                <p>{exp.description}</p>
              </div>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Experience;
